protected int countToken(String token, String target) {
    int tokenIndex = 0;
    int count = 0;
    while (tokenIndex != -1) {
        tokenIndex = target.indexOf(token, tokenIndex);
        if (tokenIndex > -1) {
            tokenIndex++;
            count++;
        }
    }
    return count;
}

protected boolean isValidFragment(String fragment) {
    if (fragment == null) {
        return true;
    }

    return isOff(NO_FRAGMENTS);
}

protected boolean isValidQuery(String query) {
    if (query == null) {
        return true;
    }

    return QUERY_PATTERN.matcher(query).matches();
}

protected boolean isValidPath(String path) {
    if (path == null) {
        return false;
    }

    if (!PATH_PATTERN.matcher(path).matches()) {
        return false;
    }

    try {
        URI uri = new URI(null, "localhost", path, null);
        String norm = uri.normalize().getPath();
        if (norm.startsWith("/../") // Trying to go via the parent dir
                || norm.equals("/..")) { // Trying to go to the parent dir
            return false;
        }
    } catch (URISyntaxException e) {
        return false;
    }

    int slash2Count = countToken("//", path);
    if (isOff(ALLOW_2_SLASHES) && (slash2Count > 0)) {
        return false;
    }

    return true;
}

protected boolean isValidAuthority(String authority) {
    if (authority == null) {
        return false;
    }

    if (authorityValidator != null && authorityValidator.isValid(authority)) {
        return true;
    }
    final String authorityASCII = DomainValidator.unicodeToASCII(authority);

    Matcher authorityMatcher = AUTHORITY_PATTERN.matcher(authorityASCII);
    if (!authorityMatcher.matches()) {
        return false;
    }

    String ipv6 = authorityMatcher.group(PARSE_AUTHORITY_IPV6);
    if (ipv6 != null) {
        InetAddressValidator inetAddressValidator = InetAddressValidator.getInstance();
        if (!inetAddressValidator.isValidInet6Address(ipv6)) {
            return false;
        }
    } else {
        String hostLocation = authorityMatcher.group(PARSE_AUTHORITY_HOST_IP);
        if (!this.domainValidator.isValid(hostLocation)) {
            InetAddressValidator inetAddressValidator = InetAddressValidator.getInstance();
            if (!inetAddressValidator.isValidInet4Address(hostLocation)) {
                return false;
            }
        }
        String port = authorityMatcher.group(PARSE_AUTHORITY_PORT);
        if (port != null && port.length() > 0) {
            try {
                int iPort = Integer.parseInt(port);
                if (iPort < 0 || iPort > MAX_UNSIGNED_16_BIT_INT) {
                    return false;
                }
            } catch (NumberFormatException nfe) {
                return false; // this can happen for big numbers
            }
        }
    }

    String extra = authorityMatcher.group(PARSE_AUTHORITY_EXTRA);
    if (extra != null && extra.trim().length() > 0) {
        return false;
    }

    return true;
}

protected boolean isValidScheme(String scheme) {
    if (scheme == null) {
        return false;
    }

    if (!SCHEME_PATTERN.matcher(scheme).matches()) {
        return false;
    }

    if (isOff(ALLOW_ALL_SCHEMES)
            && !allowedSchemes.contains(scheme.toLowerCase(Locale.ENGLISH))) {
        return false;
    }

    return true;
}

public boolean isValid(String value) {
    if (value == null) {
        return false;
    }

    URI uri; // ensure value is a valid URI
    try {
        uri = new URI(value);
    } catch (URISyntaxException e) {
        return false;
    }

    String scheme = uri.getScheme();
    if (!isValidScheme(scheme)) {
        return false;
    }

    String authority = uri.getRawAuthority();
    if ("file".equals(scheme)
            && (authority == null
                    || "".equals(authority))) { // Special case - file: allows an empty
        return true; // this is a local file - nothing more to do here
    } else if ("file".equals(scheme) && authority != null && authority.contains(":")) {
        return false;
    } else {
        if (!isValidAuthority(authority)) {
            return false;
        }
    }

    if (!isValidPath(uri.getRawPath())) {
        return false;
    }

    if (!isValidQuery(uri.getRawQuery())) {
        return false;
    }

    if (!isValidFragment(uri.getRawFragment())) {
        return false;
    }

    return true;
}

